package com.example.list_customers;

import javax.servlet.RequestDispatcher;
import javax.servlet.ServletException;
import javax.servlet.annotation.WebServlet;
import javax.servlet.http.HttpServlet;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;


@WebServlet (name = "Customers", urlPatterns = "/customers")
public class Customers extends HttpServlet {
    @Override
    protected void doGet(HttpServletRequest req, HttpServletResponse resp) throws ServletException, IOException {
        List<ListCustomers> customers = new ArrayList<>();
        customers.add(new ListCustomers("Mai Văn Hoàn", "1983-08-20", "Hà Nội", "data:image/jpeg;base64,"));
        customers.add(new ListCustomers("Nguyễn Văn Nam", "1983-08-21", "Bắc Giang", "data:image/jpeg;base64,"));
        customers.add(new ListCustomers("Nguyễn Thái Hòa", "1983-08-22", "Nam Định", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTJ5_dUWmG2KUPOlyue1hv7412nqtJEwDEwxg&usqp=CAU"));
        customers.add(new ListCustomers("Trần Đăng Khoa", "1983-08-17", "Hà Tây", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRcxc_gMwqrqqM4fQ22IzJJ99MHl-P4E3_Wwg&usqp=CAU"));
        customers.add(new ListCustomers("Nguyễn Đình Thi", "1983-08-19", "Hà Nội", "data:image/jpeg;base64,"));

        req.setAttribute("customers", customers);

        RequestDispatcher requestDispatcher = req.getRequestDispatcher("/showCustomer.jsp");
        requestDispatcher.forward(req, resp);
    }

    @Override
    protected void doPost(HttpServletRequest req, HttpServletResponse resp) throws ServletException, IOException {

    }

    @Override
    public void init() throws ServletException {
        super.init();
    }
}
